"bidder.info.message10":"Cliquez sur un des liens ci-dessous pour aller à l'une des pages de statut d'offre de cet enchérisseur","bidder.info.message11":"Vous êtes sur le point de réinitialiser ce compte enchérisseur, qui fera ce qui suit","bidder.info.message12":"Effacer l'adresse courriel actuelle associée à ce numéro d'enchérisseur","bidder.info.message13":"Réinitialiser les limites d'offres à 1 / $ 4,000 USD","bidder.info.message14":"Réinitialiser le mot de passe (un nouveau mot de passe sera envoyé par la poste à l'enchérisseur)",
