"bidder.info.message2":"Les membres disposant d'un compte inactif peuvent rechercher des véhicules et consulter l’inventaire, mais ils ne peuvent pas faire d'offres ni acheter des véhicules.","bidder.info.message20":"Enchérir sur plusieurs véhicules","bidder.info.message21":"Recevoir le pouvoir d'achat substantielle (aucun dépôt supplémentaire requis)","bidder.info.message22":"Ajouter trois utilisateurs de compte sans frais supplémentaires","bidder.info.message23":"Adhésion Premier requiert les droits d'inscription initiale de 200 $, un dépôt de 400 $ entièrement remboursable et des copies de toutes les licences actuelles (le cas échéant). Les membres Premier paient une droit de renouvellement annuelle.",
"bidder.info.message24":"Compte devrait être plus grand que zéro","bidder.info.message25":"Compte devrait être un numéro.","bidder.info.message26":"Le montant devrait être plus grand que zéro","bidder.info.message27":"Montant devrait être un nombre.","bidder.info.message3":"Les membres ayant des comptes suspendus n'ont aucun accès aux offres et aux achats, mais leur accès peut éventuellement être restauré à une date ultérieure.","bidder.info.message4":"Les membres ayant des comptes annulés font l'objet d'une suspension ou d'une fermeture permanente de leur compte.",
"bidder.info.message5":"Un enchérisseur est un membre de Copart qui place une offre au cours de la phase préliminaire d'appel d'offres de vente ou de vente aux enchères. Par l'utilisation de la technologie brevetées de vente aux enchères en ligne de Copart les enchérisseurs concurrence les uns contre les autres pour présenter l'offre finale la plus élevée - et, finalement, gagner leur véhicule de choix.","bidder.info.message6":"Les enchérisseurs ont différents niveaux d'admissibilité d'offres déterminés par les réglementations nationales et locales. Un autre facteur qui influe l'admissibilité est les licences particulières que les membres ont le fichier avec Copart. Membres sans licences peuvent enchérir sur les véhicules « Aucune licence requise », mais doivent payer la taxe de vente, le cas échéant.",
